import React from "react";
import { Box, Typography } from "@mui/material";
import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header";
import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
  root: {
    display: "flex",
    justifyContent: "center",
  },
  content: {
    // display: "flex",
    // flexDirection: "column",
    alignContent: "center",
    justifyContent: "center",
  },
});

function App() {
  const classes = useStyles();

  return (
    <>
      <Header />
      <Box className={classes.content}>
        <img id="profile-pic" src="alyssa.jpg" alt="Alyssa Wang"></img>
        <Box className="typewriter" sx={{ marginBottom: "10px" }}>
          <Typography variant="h1" className={classes.root}>
            {" "}
            ALYSSA WANG{" "}
          </Typography>
        </Box>
        <Typography className={classes.root}>
          SWE at <a href="https://www.mitre.org/">MITRE</a>
        </Typography>
        <Typography className={classes.root}>
          <a href="https://www.williams.edu/"> Williams College </a> '20
        </Typography>
        <Typography className={classes.root}>
          <a href="https://csci.williams.edu/"> Computer Science </a> •
          <a href="https://comp-lit.williams.edu/"> Comparative Literature </a>
        </Typography>
        <Typography className={classes.root}>
          <a href="https://github.com/AlyssaWang"> Github </a> •
          <a href="https://linkedin.com/in/alyssacwang"> LinkedIn </a>
        </Typography>
      </Box>
    </>
  );
}

export default App;
